import Nav from 'react-bootstrap/Nav'
import React from 'react';




function Navbar(){

    const nav_items_left = [
        { key: "home", title: "Hem" },
        { key: "events", title: "Pub & Event" },
        { key: "km", title: "Klubbm채steriet" },
        { key: "contact", title: "Klubbm채steriet" }
    ];

    const nav_items_right = [
        { key: "login", title: "Logga in" },
    ];

    const content_left = nav_items_left.map((item) => {
        return (
            <Nav.Item>
                <Nav.Link activeKey={item.key}> {item.title} </Nav.Link>
            </Nav.Item>
        )
    });

    return (
        <Nav className={"clearfix"}>
            <div className={"left"}>
                { content_left }
            </div>

            <div className={"right"}>
                { content_right }
            </div>
        </Nav>
    )
}

export default Navbar
